  c4_G = (real_T (*)[6])ssGetOutputPortSignal(chartInstance->S, 2);
  c4_M = (real_T (*)[36])ssGetOutputPortSignal(chartInstance->S, 1);
  chartInstance->c4_doneDoubleBufferReInit = TRUE;
  c4_u = sf_mex_dup(c4_st);
